import base64
import gzip

# Die 3 Teile der base64-Zeichenfolge
part1 = ""  # Teil 1 wird hier eingefügt

part2 = "三"  # Teil 2 wird hier eingefügt
part3 = ""  # Teil 3 wird hier eingefügt

# Zusammensetzen der Teile
base64_string = part1 + part2 + part3

# Dekodiere base64 zu Gzip
gz_data = base64.b64decode(base64_string)

# Entpacke Gzip zu STEP
with open("AbsaugungsSensor.step", "wb") as f:
    f.write(gzip.decompress(gz_data))

print("STEP-Datei erstellt!")
